  [],\n\t\"title\": \"Preliminary hard and soft bottom seafloor substrate map (5m
  grid) derived from an unsupervised classification of gridded backscatter and bathymetry
  derivatives at Rose Atoll Lagoon, Territory of American Samoa, USA.\",\n\t\"tracking_summary\":
  {\n\t\t\"total\": 0,\n\t\t\"recent\": 0\n\t},\n\t\"groups\": [],\n\t\"relationships_as_subject\":
  [],\n\t\"revision_timestamp\": \"2015-09-26T20:36:34.377599\",\n\t\"name\": \"preliminary-hard-and-soft-bottom-seafloor-substrate-map-5m-grid-derived-from-an-unsupervised-cl\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"Preliminary hard and soft seafloor substrate
  map derived from an unsupervised classification of multibeam backscatter and bathymetry
  derivatives at Rose Atoll Lagoon, Territory of American Samoa, USA. The dataset
  was created from gridded (5 m cell size) multibeam bathymetry derivatives collected
  aboard R/V AHI; 2 scales of bathymetric variance and bathymetric rugosity, and from
  multibeam backscatter. Backscatter data were from a 240 kHz Reson 8101 sonar, gridded
  at 5 m. Very limited seafloor photographs for groundtruthing are available for Rose
  Atoll and therefore no supervised classification was performed and we are unable
  to visually or empirically evaluate the accuracy of the unsupervised classification
  seafloor substrate map. However, in locations such French Frigate Shoals, NWHI and
  Tutuila, American Samoa, where ground truth data are available, the unsupervised
  classification method is a robust predictor of substrate type in similar depth ranges
  and seafloor environments. Since groundtruthing was not used to validate the unsupervised
  classification at Rose Atoll Lagoon extreme caution should be used when examining
  these data to locate habitat of biological significance. The map should be used
  in conjunction with bathymetric derivatives such as rugosity, slope, and Bathymetric
  Position Index (BPI).\",\n\t\"license_title\": null,\n\t\"extras\": [{\n\t\t\"key\":
